import { useState } from 'react';
import { Link } from 'react-router-dom';

function Login() {
  const [login, setLogin] = useState({
    email: '',
    password: '',
  });

  const onTyping = ({ target }) => {
    console.log(target);
    setLogin({...login, })
  }
  return (
    <div>
      <form>
        <label htmlFor="email">
          Nome de usuário ou e-mail:
          <input
            input="text"
            placeholder="Insira seu nome de usuário ou e-mail"
            id="email"
            name="email"
            value={ login.email }
            onChange = { onTyping }
          />
        </label>
        <label htmlFor="password">
          Senha:
          <input
            type="password"
            placeholder="Insira sua senha"
            id="password"
            name="password"
            value={ login.password }
            onChange = { onTyping }
          />
        </label>
      </form>
      <button
        type="button"
        onClick={ () => {} }
      >
        Login
      </button>
      <Link to="/newuser">Criar novo usuário</Link>
    </div>
  );
}

export default Login;
